import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const styles = {
li: {
    listStyleType: 'none',
    marginLeft: '-1vw',
    fontSize: '1.5rem',
    fontWeight: '600'
  }
}

const List = props => {
  return (
    <ul style={styles.li}>
      <li >
        <FontAwesomeIcon icon="arrow-right" />
        &ensp; {props.children}
      </li>
    </ul>
  );
};

export default List;
